const createRoute = (routeName) => {
    return window.location.host.includes('localhost') ?
        `http://localhost:8000/${routeName}`
        : `/${routeName}`
}
export const REQUEST_RESULTS_LIMIT = 20
export const CREATE_ROUTE = createRoute
export const TABS = {
    CATEGORIES: "CATEGORIES",
    CATEGORIES: "CATEGORIES"

}
